import { Layout, Menu } from 'antd';
import React from 'react';
const { Header } = Layout;

const Navbar = () => (
  <Layout className="layout">
    <Header>
      <div className="logo" />
      <Menu
        theme="ligth"
        mode="horizontal"

      />
    </Header>

  </Layout>
);

export default Navbar;
